⏩W tej części spotykamy Jessice Stone, gwiazdę serialu ,,Starfield’’ oraz Imogen Lovelace, fankę tegoż serialu. Tym razem cała akcja dzieje się na konwencie cospley’owym. Jessica, która totalnie ma dość bycia gwiazda serialu składa propozycję Imogen, by na cały konwent (czyli 4 dni) zamieniły się rolami. Obie dziewczyny są bardzo do siebie podobne, co jeszcze bardziej zachęca. Obie się godzą. Imogen wchodzi w swoją rolę i daje wywiady oraz autografy. Coraz więcej czasu poświęca Ethan’owi – agentowi Jess. Z kolei Jess zajmuje się stoiskiem razem z koleżanką z Internetu, Harper. Razem propagują akcję #UratujmyAmarę. Obie uczą się czegoś nowego w swoich rolach. Czy uda im się wykorzystać moment i zdobyć dla siebie najważniejszą osobę?

✅Zarówno ta, jak i poprzednia książka, zrobiły na mnie ogromne wrażenie. Ta część jest retellingiem ,,Księcia i żebraka’’, więc wiadomo o co chodzi 😉 Zaskakuje mnie to, w jak łatwy sposób autorka wprowadza wątki i osoby homoseksualne do historii. Mega mi się to podoba, ponieważ nigdzie wcześniej nie spotkałam się z takimi bohaterami i dlatego ode mnie wielkie ukłony w jej stronę. Polecam!

